import React from 'react';

import logo from "../assets/logo-small.png"

const login = () => {

    return (
        <div>
            <div className="login-container">
                <div className="login-box">
                    <div className="login-logo">
                        Sign in
                    <img src={logo} alt="kaamyabi logo" />
                    </div>
                </div>
            </div>
        </div>
    )


}

export default login;
